import {ajaxWrapper} from "../../helpers/ajaxWrapper";
import {urls} from "../../helpers/constant";

export const login = (data) => {
	const url = `${urls.USER}/login`;
	return ajaxWrapper({
		method: 'POST',
		url,
		data,
	}).then(data => data.data)
};
